import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD Application</h1>
      <label>Movie name</label>
      <input type="text" name="movieName" />
      <br />
      <label>Review</label>
      <input type="text" name="review" />
      <input type="button" value="Send" />
    </div>
  );
}

export default App;
